import React from "react";
import { Link, useLocation } from "react-router-dom";

const Nav = () => {
  const lienActif = useLocation();
  return (
    <div className="navbar">
      <nav className="headernav">
        <Link
          to="/"
          className={`link ${lienActif.pathname === "/" ? "actif" : ""}`}
        >
          Accueil
        </Link>
        <Link
          to="/Massages"
          className={`link ${
            lienActif.pathname === "/Massages" ? "actif" : ""
          }`}
        >
          Massage Ã  domicile
        </Link>
        <Link
          to="/Tarifs"
          className={`link ${lienActif.pathname === "/Tarifs" ? "actif" : ""}`}
        >
          Tarifs
        </Link>
        <div className="telephoneconteneur">
        <ul class="menu">
  <li>
    <a href="#">Parent Link</a>
    
    <ul>
      <li><a href="#">Child Link</a></li>
      <li><a href="#">Child Link</a></li>
      <li><a href="#">Child Link</a></li>
      <li><a href="#">Child Link</a></li>
    </ul>
  </li>
</ul>
        </div>
      </nav>
    </div>
  );
};

export default Nav;
<img
src="https://i.goopics.net/4ujmmk.png"
className="telephone"
alt="telephone"
/>
